import React, {Component} from 'react';

class App extends Component {

    constructor(props){
        super(props);
        this.state = {
            contacts: ''
        }
    }

    componentDidMount() {
        fetch('https://api.openweathermap.org/data/2.5/weather?q=london&APPID=d5566182730361aa1c00849d2f86bb95')
        .then(res => res.json())
        .then((data) => {
        //   this.setState({ contacts: data })
        console.log(data)
        })
        .catch(console.log)
    }

    render () {
        return (
            <p>{this.state.contacts}</p>
        );
    }
}

export default App;
